                                            mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 布），海关总署重新修订了《中华人民共和国进境物品归类表》（以下简称《归类表》）及《中华人民共和国进境物品完税价格表》（以下简称《完税价格表》），现予以</span></font></p>
        <p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
           background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:&quot;微软雅黑&quot;,&quot;sans-serif&quot;;
                                            mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公布，自<span lang="EN-US">2012</span>年<span lang="EN-US">4</span>月<span lang="EN-US">15</span>日起执行。海关总署<span lang="EN-US">2007</span>年<span lang="EN-US">6</span>月修订的《入境旅客行李物品和个人邮递物品进口税税则归类表》及《入境旅客行李物品和个人邮递物品完税价格表》</span></font></p>
        <p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
           background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:&quot;微软雅黑&quot;,&quot;sans-serif&quot;;
                                            mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （海关总署公告<span lang="EN-US">2007</span>年第<span lang="EN-US">25</span>号公布）同时废止。现就有关事宜公告如下：<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:
                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 一、进境物品依次遵循以下原则归类：<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:
                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （一）《归类表》已列名的物品，归入其列名类别；<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:
                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （二）《归类表》未列名的物品，按其主要功能（或用途）归入相应类别；<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:
                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （三）不能按照上述原则归入相应类别的物品，归入<span lang="EN-US">“</span>其他物品<span lang="EN-US">”</span>类别。<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
