                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 二、进境物品完税价格遵循以下原则确定：<span lang="EN-US"></span></span></font></p>
        <font size="3">

