                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:
                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （一）进境物品的完税价格由海关依法遵循以下原则确定：<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;
