                                            0pt" lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2</span><span style="font-size:9.0pt;font-family:&quot;微软雅黑&quot;,&quot;sans-serif&quot;;
                                            mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">．《完税价格表》未列明完税价格的物品，按照相同物品相同来源地最近时间的主要市场零售价格确定其完税价格；<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;
                                            font-family:&quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:
                                            0pt" lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3</span><span style="font-size:9.0pt;font-family:&quot;微软雅黑&quot;,&quot;sans-serif&quot;;
                                            mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">．实际购买价格是《完税价格表》列明完税价格的<span lang="EN-US">2</span>倍及以上，或是《完税价格表》列明完税价格的<span lang="EN-US">1/2</span>及以下的物品，进境物品所有人应向海关提供销售方依法开具的真</span></font></p>
        <p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
           mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:&quot;微软雅黑&quot;,&quot;sans-serif&quot;;
                                            mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 实交易的购物发票或收据，并承担相关责任。海关可以根据物品所有人提供的上述相关凭证，依法确定应税物品完税价格。<span lang="EN-US"></span></span></font></p>
        <font size="3">

        </font><p class="MsoNormal" style="text-align:left;mso-pagination:widow-orphan;
                  mso-outline-level:4;background:white" align="left"><font size="3"><span style="font-size:9.0pt;font-family:
                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （二）边疆地区民族特需商品的完税价格按照海关总署另行审定的完税价格表执行。<span lang="EN-US"></span></span></font></p>
        <font size="3">

