                                            &quot;微软雅黑&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 三、纳税义务人对进境物品的归类、完税价格的确定持有异议的，可以依法提请行政复议。<span lang="EN-US"></span></span></font></p>
